import carpenter from '../assets/service_images/carpenter_image.jpg';
import plumber from '../assets/service_images/plumber_image.jpg';
import electrician from '../assets/service_images/electrician.jpg';
import painter from '../assets/service_images/painter.jpg';
// import cleaner from '../assets/service_images/cleaner.jpg';
import defaultImg from '../assets/service_images/default.jpg';

const images = {
    carpenter,
    plumber,
    electrician,
    painter,
    // cleaner,
    default: defaultImg
};

export default images;
